var hero:MovieClip;
var ground:MovieClip;
var sndCtrl:MovieClip;

stop();

init();

function init():void {
	hero = MovieClip(parent).hero;
	ground = MovieClip(parent).ground;
	sndCtrl = MovieClip(root);
}

function update():void {
	if (this.currentFrame == 1) {
		if (hero.bound.hitTestObject(this)) {
			this.gotoAndPlay(2);
		}
	}
}
